27749, 48.86963317302491',489,0,'Madeleine',1,'Point',0,'MADELEINE',43898,1,2215,'Metro',3,0,0,650579.0401,6863500.3584,NULL,'','8','0',110,'0','8','8-108039',0,'Madeleine','0',0,0,0,0,48.86963317302491,2.326272274027749,'https://upload.wikimedia.org/wikipedia/commons/thumb/c/cb/Paris_06_2012_Line_12_Metro_Madeleine_3128.JPG/1200px-Paris_06_2012_Line_12_Metro_Madeleine_3128.JPG','Madeleine est une station des lignes 8, 12 et 14 du métro de Paris, située dans le 8e arrondissement de Paris.Par-delà celui de la sainte chrétienne, Marie de Magdala dite Marie Madeleine, son nom rappelle le petit bourg qui s’était développé au vie siècle, à l\'ouest de la capitale, autour d’un fief de l’évêque de Paris. Il s’appela rapidement La Ville-l’Évêque et sa chapelle fut dédiée à sainte Madeleine au xiiie siècle.'),(54,'RATP','A01544',0,'M11',0,0,'METRO',3,'2.416479643671439, 48.8797612539972',494,0,'Mairie des Lilas',1,'Point',0,'MAIRIE DES LILAS',44055,1,2298,'Metro',3,0,0,657204.3492,6864573.8589,NULL,'','11','0',110,'M11','11','11-111033',0,'Mairie des Lilas','0',0,0,0,0,48.8797612539972,2.416479643671439,NULL,NULL),(55,'RATP','A01541',0,'M8',0,0,'METRO',15,'2.446927484242136, 48.802637690718086',499,0,'Maisons-Alfort-Les Juilliottes',1,'Point',0,'MAISONS-ALFORT-LES JUILLIOTTES',44067,1,2192,'Metro',3,0,0,659377.3049,6855982.3601,NULL,'','8','0',110,'0','8','8-108085',0,'Maisons-Alfort-Les Juilliottes','0',0,0,899946,0,48.802637690718086,2.446927484242136,NULL,NULL),(56,'RATP','A01541',0,'M8',0,0,'METRO',15,'2.434509895933692, 48.809144360936045',500,0,'Maisons-Alfort-Stade',1,'Point',0,'MAISONS-ALFORT-STADE',44066,1,2193,'Metro',3,0,0,658470.4404,6856712.2781,NULL,'','8','0',110,'0','8','8-108083',0,'Maisons-Alfort-Stade','0',0,0,0,0,48.809144360936045,2.434509895933692,NULL,NULL),(57,'RATP','A01540',0,'M7',0,0,'METRO',13,'2.358473883854336, 48.8224378345855',497,0,'Maison Blanche',1,'Point',0,'MAISON BLANCHE',44057,1,2160,'Metro',3,0,0,652898.4845,6858233.0223,NULL,'','7','0